contracts/SgAML.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

contract SgAML{

    string[] bannedCountries = ["Iraq","North Korea","Russia"];

    uint maxAmount = 30; 

    function checkNationality(string memory userNationality) public view returns(bool){

        //check if userNationality in bannedCountries
        for (uint i = 0; i < bannedCountries.length; i++) {
            if (keccak256(abi.encodePacked(bannedCountries[i])) == keccak256(abi.encodePacked(userNationality))) {
            return true;
            }
        }
        return false;
    }

    function checkPoliticalStatus(bool isPoliticallyExposed) public pure returns(bool){

        return  isPoliticallyExposed;
    }

    function checkAmt(address payable sender, uint amount) public payable returns(bool) {
        if(amount>maxAmount){
            return false; 
        }
        return true; 
    }






}

